import React, {useState, useEffect } from 'react';

import { getArray } from '../../api/api';
import Typography from '@material-ui/core/Typography';


const Dashboard = () => {

    interface IDashboard {
        firstName: string;
        lastname: string;
    }

    const [chiropractorDetails, setchiropractorDetails] = useState<any>({ firstName: '', LastName: '' })

    useEffect(() => {
        setchiropractorDetails(getArray());
    }, [])

    console.log(chiropractorDetails);

    return (
        <>
            <Typography>{chiropractorDetails}</Typography>
        </>    
    )
}

export default Dashboard;
